import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Titulofinal from './Componentes_primarios/Titulo.js';
import Cajafinal from './Componentes_primarios/Caja.js';
/*
function CajaTexto(props){
  return(
    <div><input type="text" name="nombredelacaja" placeholder={props.PlaceHolderUsuario}/></div>  
  )
}
*/

class Page extends React.Component{
  render(){
    return(
      <div>
        <Titulofinal></Titulofinal>
      </div>
    )
  }
}
/*
class Caja extends React.Component{
  render(){
    return(
      <div>
        <Cajafinal></Cajafinal>
      </div>
    )
  }
}*/
class FormLogin extends React.Component{
  render(){
    return(
      <div>
        <div><Cajafinal></Cajafinal></div>
        <div><input type="password" name="txtPassword" placeholder="**********"/></div>
        <div><button type="button">Click Me!</button></div>
        <p><a href="#"></a>¿¿Has olvidado el id de ingreso o contraseña??</p>
      </div>
    )
  }
}
//<FormLogin TituloPrincipal="KeyManage" PlaceHolderUsuario="Usuario"></FormLogin>
class App extends React.Component{
  render(){
    return(
      <div className="App">
      <header className="App-header">
        <div className="">
          <Page></Page>
        </div>
        <div className="">
          <FormLogin></FormLogin>
        </div>
      </header>
    </div>
    )
  }
}

